// src/App.js
import React, { useState } from 'react';
import {
  Container, Typography, Button, TextField, MenuItem, Select,
  FormControl, InputLabel, Checkbox, FormControlLabel, Box, IconButton
} from '@mui/material';
import { DateTimePicker } from '@mui/x-date-pickers/DateTimePicker';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';
import CalendarTodayIcon from '@mui/icons-material/CalendarToday';
import './App.css';

function App() {
  const [title, setTitle] = useState('');
  const [startDate, setStartDate] = useState(new Date());
  const [endDate, setEndDate] = useState(new Date());
  const [repeat, setRepeat] = useState('');
  const [notificationTime, setNotificationTime] = useState('15 minutes before');
  const [allDay, setAllDay] = useState(false);
  const [view, setView] = useState('day');

  const handleSave = () => {
    // Save the to-do item
    console.log({
      title,
      startDate,
      endDate,
      repeat,
      notificationTime,
      allDay
    });
  };

  return (
    <LocalizationProvider dateAdapter={AdapterDateFns}>
      <div className="container">
        <header className="header">
          <h1>Today, 15-05-2024</h1>
          <div className="day-month-toggle">
            <button
              className={view === 'day' ? 'active' : ''}
              onClick={() => setView('day')}
            >
              Day
            </button>
            <button
              className={view === 'month' ? 'active' : ''}
              onClick={() => setView('month')}
            >
              Month
            </button>
          </div>
        </header>
        <div className="main">
          <div className="calendar">
            {/* Calendar will be placed here */}
          </div>
          <div className="todo-form">
            <form>
              <TextField
                label="Add a title"
                fullWidth
                value={title}
                onChange={(e) => setTitle(e.target.value)}
                margin="normal"
              />
              <DateTimePicker
                label="Start Date"
                value={startDate}
                onChange={(date) => setStartDate(date)}
                renderInput={(params) => <TextField {...params} fullWidth margin="normal" />}
              />
              <DateTimePicker
                label="End Date"
                value={endDate}
                onChange={(date) => setEndDate(date)}
                renderInput={(params) => <TextField {...params} fullWidth margin="normal" />}
              />
              <FormControl fullWidth margin="normal">
                <InputLabel>Repeat</InputLabel>
                <Select
                  value={repeat}
                  onChange={(e) => setRepeat(e.target.value)}
                >
                  <MenuItem value=""><em>None</em></MenuItem>
                  <MenuItem value="daily">Daily</MenuItem>
                  <MenuItem value="weekly">Weekly</MenuItem>
                  <MenuItem value="monthly">Monthly</MenuItem>
                </Select>
              </FormControl>
              <FormControl fullWidth margin="normal">
                <InputLabel>Notification</InputLabel>
                <Select
                  value={notificationTime}
                  onChange={(e) => setNotificationTime(e.target.value)}
                >
                  <MenuItem value="5 minutes before">5 minutes before</MenuItem>
                  <MenuItem value="10 minutes before">10 minutes before</MenuItem>
                  <MenuItem value="15 minutes before">15 minutes before</MenuItem>
                  <MenuItem value="30 minutes before">30 minutes before</MenuItem>
                  <MenuItem value="1 hour before">1 hour before</MenuItem>
                </Select>
              </FormControl>
              <FormControlLabel
                control={<Checkbox checked={allDay} onChange={(e) => setAllDay(e.target.checked)} />}
                label="All day"
                margin="normal"
              />
              <Button variant="contained" color="primary" onClick={handleSave} style={{ marginTop: '20px' }}>Save</Button>
            </form>
          </div>
        </div>
      </div>
    </LocalizationProvider>
  );
}

export default App;
